★首の血行を改善し、コリを緩和します。<br>
<br>
●磁気カプセルはコリの気になる箇所に自由に移動できます。<br>
●カラーコーディネイトを楽しめる多彩なカラー。繊維ならではのやさしい着け心地です。<br>
●N極S極交互配列<br>
フェライト永久磁石を採用しています。コラントッテ独自の交互配列になっており、<br>
広範囲に磁力が影響し血行を改善、コリを緩和します。ます。点ではなく面での効果を得ることができ、<br>
着用しているだけで血行を改善し、コリを緩和します。また、磁気カプセルは自由に移動できますので、<br>
気になる箇所にあててお使いいただけます。<br>
<br>
■素材<br>
本体　ポリエステル、ナイロン、レーヨン、綿<br>
留具・磁気カプセル　PP樹脂　フェライト永久磁石100mT（1000Ｇ）8個をN極S極交互配列<br>
■医療機器認証番号：221AGBZX00117000<br>
■企画製造販売元：株式会社アーク・クエスト
<BR>
<BR>
■サイズ<br>
Mサイズ45cm<br>
Lサイズ50cm<br><br><br>
