★コラントッテのスポーツ磁気ネックレス！<br>
<br>
●120mT(1200G)×8個の希土類永久磁石をN極S極交互配列で内蔵し、着けるだけで首の血行改善、筋肉のコリに効きます！<br>
●希土類永久磁石をシリコンの中に内蔵することに成功し、スッキリとした構造で軽くしなやかなフィット感を実現！<br>
●オールシリコン製でバスケットボール・サッカーなど接触のあるスポーツでも安心して使用でき、水や汗にも強いウォータープルーフで様々なスポーツシーンで活躍！<br>
●フェイス部分を付け替えて、ファッションや気分に合せてカラー変更も可能！色々なパターンを作り出せて、コーディネートも楽しめます。<br>
<br>
■素材<br>
本体 シリコン<br>
磁石 希土類永久磁石120mT(1200G)8個をN極S極交互配列<br>
■医療機器認証番号 224AGBZX00090000<br>
■企画製造販売元 株式会社アーク・クエスト<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。 
<BR>
<BR>
■サイズ S(約42cm)、M(約47cm)、L(約53cm)<br>
