★首・肩の血行を改善し、コリを緩和します。<br>
<br>
●磁気ネックレスとは思えない愛らしさ。<br>
●小花を散らしたようにキュートに華やかに首元を飾ります。<br>
●カジュアルでもフェミニンでもシーンを選ばず美しく健康にあなたを輝かせます。<br>
●磁気チャームの一つ一つを熟練の工芸的技術でカラー樹脂を手作業で加工。<br>
●伝統の七宝焼の技術を採用し、専用釜にて両面でおおよそ8～10時間以上の手間をかけて製作しています。<br>
●ひとつひとつの色に表れる深みと艶に絶大なるこだわりを持って作り上げたからこそ、小さいけれど存在感のあるネックレスに仕上がりました。<br>
●チェーン、留具も全て金属部分は金属アレルギーなどを起こしにくく、体に優しい純チタンを使用しています。<br>
<br>
●【N極S極交互配列】<br>
純チタンで作られた磁気チャームにはN極S極交互配列のコバルト永久磁石130mT(1300G)×2個が埋め込まれています。<br>
合計10個の磁石が血行を改善し、コリを緩和します。<br>
女性に多い肩コリの経路に当たるように配置を考えました。<br>
<br>
■素材<br>
・(チェーン・留具・ロゴプレート)純チタン(磁石チャーム)純チタン、カラー樹脂(七宝焼)<br>
・コバルト永久磁石130mT(1300Ｇ)10個をN極S極交互配列<br>
■医療機器認証番号：220AGBZX00348000<br>
■企画製造販売元：株式会社アーク・クエスト
<BR>
<BR>
■サイズ 41～43cm（丸カン4個付き）<br><br><br>
